import React from 'react';
import { TimeLineData } from '../../constants/constants';

import './TimeLine.css'

const TimeLine = () => {
  return (
    <div className="timeline__main-container">
      <h1>Timeline</h1>
      <p>I've started my journey back in 2014 at university.
         Finished with little experience and faced the "minimum 3+ years of..." wall.</p>
      {TimeLineData.map(({year, text}, index) => (
        <div key={index}>
          <h4>{year}</h4>
          <p>{text}</p>
        </div>
      ))}
    </div>
  )
}

export default TimeLine
